import { createStore } from 'vuex'
import axios from 'axios'

const store = createStore({
    state: {
      users: [],
    },
    mutations: {
      getUser(state, users){
        state.users = users;
      },
    },
    actions: {
      async getUserData({commit}){
        try {
          await axios.get('https://localhost:44382/api/v1/Users').then((respond) => {
            commit('getUser', respond.data)
          })
        } catch (error) {
          console.log(error);
        }
      }
    }
})

export default store
